import React from "react";
import  ReactDOM  from "react-dom";

function Greeting(){
  return 
  <div>
    <h1>
      this is me and nice to meet u
    </h1>
    <p>
      Hello world
    </p>
    <div></div>
  </div>
}
ReactDOM.render(<Greeting />, document.getElementById("root"));
